$(window).on( 'elementor/frontend/init', () => { //wishes.default
   const addHandler = ( ) => {
       loadWish();
        $('input#attend').change(function(){
            if (this.checked) {
                $('#number-attend').css('display','block');
                $('select[name="numb-attendence"]').prop('selectedIndex',1);
                $('label[for="attend"]').addClass('active');
                $('label[for="no-attend"]').removeClass('active');
            }
        });
        $('input#no-attend').change(function(){
            if (this.checked) {
                $('#number-attend').css('display','none');
                $('select[name="numb-attendence"]').prop('selectedIndex',0);
                $('label[for="no-attend"]').addClass('active');
                $('label[for="attend"]').removeClass('active'); 
            }
        });
        $(document).on("submit", "form#wishes-form" , function (e) {
            e.preventDefault();
            var name = $('input[name="name"]').val();
            var wishes = $('textarea[name="wishes"]').val();
            var attendance = $("input[name='attendance']:checked").val();
            var guest = $("select[name='numb-attendence']").val();
            if(name.length >1 && wishes.length >2){
                $.ajax({
                    url: 'https://foreverr.id/f6018700d720c997933c088b3493981ffe50602e/api/foreverr/v2/guestbook/'+foreverr._inv_id+'/send',
                    method: "post",
                    data: {
                        nama            : name,
                        wishes          : wishes,
                        attendance      : attendance,
                        guest           : guest,
                    },
                    beforeSend: function (request) {
                            request.setRequestHeader('X-WP-Nonce', foreverr._auth);
                            $('.wish-alert span').remove();
                                    $('.wish-alert').append(`
                                        <div class="spinner-container">
                        	               <span class="wish-spinner"></span>
                                            <span>Loading...</span>
                        	           </div>
                        	       `);
                            },
                    success: function (response) {
                        $('.wish-alert .spinner-container').remove();
                        $('textarea[name="wishes"]').val('');
                        $('input#attend').prop('checked', false);
                        $('input#no-attend').prop('checked', false);
                        $('input#no-attend').prop('checked', false);
                        $('label.attend').removeClass('active');
                        $('#number-attend').css('display','none');
                        Arumi({
                            status: 'success',
                            content: 'Ucapan berhasil dikirim!',
                            timer: 4000,
                            animation: true,
                            progress: true,
                            icon: true,
                        });
                        loadWish();
                	    },
                	error: function() {
                         $('.wish-alert .spinner-container').remove();
                         Arumi({
                            status: 'danger',
                            content: 'Ucapan Terdeteksi Duplikat',
                            timer: 4000,
                            animation: true,
                            progress: true,
                            icon: true,
                        });
                   }
                });
            }
        });
        function loadWish(paged){
            var pagenumb = paged ? paged : 1;
            $.ajax({
                    url: 'https://foreverr.id/f6018700d720c997933c088b3493981ffe50602e/api/foreverr/v2/guestbook/'+foreverr._inv_id+'?page='+pagenumb,
                    method: "get",
                    beforeSend: function (request) {
                        request.setRequestHeader('X-WP-Nonce', foreverr._auth);
                        $('.wishes-box').empty();
                        $('.pagenumb a').remove();
                        $('.wishes-box').append(`
                                    <div class="spinner-container" style="height:35vh">
                    	               <span class="wish-spinner"></span>
                                        <span>Loading...</span>
                    	           </div>
                    	           `);
                    },
                    success: function (response) {
                        $('.wishes-box .spinner-container').remove();
                        var data = response.data;
                        $.each(data, function(i, item){
                            $('.wishes-box').append(`
                            <div class="wish-item">
                                <div class="wish-avatar">
                                    <svg viewBox="0 0 566.67 560" xmlns="http://www.w3.org/2000/svg" width="30px" height="30px">
                                      <defs><style>.cls-1{fill:none;}.cls-2{fill:#fff;}</style></defs>
                                      <circle class="cls-1" cx="286.67" cy="280" r="280"></circle>
                                      <circle cx="280" cy="280" r="280" class="avatar_color"></circle>
                                      <path d="M 377.52 203.31 C 377.52 257.169 333.859 300.83 280 300.83 C 226.141 300.83 182.48 257.169 182.48 203.31 C 182.48 149.451 226.141 105.79 280 105.79 C 333.859 105.79 377.52 149.451 377.52 203.31 Z M 474.19 464.61 C 368.21 574.877 191.79 574.877 85.81 464.61 C 102.17 372.2 182.89 302 280 302 C 377.11 302 457.83 372.17 474.19 464.61 Z" class="cls-2"></path></svg>
                                </div>
                                <div class="wish-data">
                                    <div class="data-name">
                                        <span>${item.name}</span>
                                        ${item.attendance == 'Hadir' ? '<span class="attend-status"><img src="/wp-content/assets/icon/hadir.svg" /></span>':''}
                                        ${item.attendance == 'Tidak Hadir' ? '<span class="attend-status"><img src="/wp-content/assets/icon/tidakhadir.svg" /></span>':''}
                                    </div>
                                    <div class="data-date">${item.date}</div>
                                    <div class="data-content">${item.wishes}</div>
                                </div>
                            </div>
                            `);
                        });
                        if(response.total_page > 1){
                            $('.pagenumb').prepend(`
                                    ${response.current_page == 1 ? ``:`<a class="item prev" value="${(parseInt(response.current_page) - 1)}"><svg xmlns="http://www.w3.org/2000/svg" width="13" height="13" fill="currentColor" class="bi bi-arrow-left" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M15 8a.5.5 0 0 0-.5-.5H2.707l3.147-3.146a.5.5 0 1 0-.708-.708l-4 4a.5.5 0 0 0 0 .708l4 4a.5.5 0 0 0 .708-.708L2.707 8.5H14.5A.5.5 0 0 0 15 8z"/></svg></a>`}
            	                `);
                            for (var i = 1; i <= response.total_page; i++){
                                $('.pagenumb').append(`
                                ${i == response.current_page ? `<a class="current" value="${i}" >${i}</a>`:`<a class="item" value="${i}" >${i}</a>` }
                                `);
                            }
                            $('.pagenumb').append(`
                                    ${response.current_page == response.total_page || response.total_page == 0  ? ``:`<a class="item next" value="${(parseInt(response.current_page) + 1)}"><svg xmlns="http://www.w3.org/2000/svg" width="13" height="13" fill="currentColor" class="bi bi-arrow-right" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M1 8a.5.5 0 0 1 .5-.5h11.793l-3.147-3.146a.5.5 0 0 1 .708-.708l4 4a.5.5 0 0 1 0 .708l-4 4a.5.5 0 0 1-.708-.708L13.293 8.5H1.5A.5.5 0 0 1 1 8z"/></svg></a>`}
            	                `);
                        }
                    }
                });
            }    
        $(document).on('click', '.pagenumb .item', function(e){
            e.stopPropagation();
            e.stopImmediatePropagation();
            var paged = $(this).attr('value');
            loadWish(paged);
        });
   };
   elementorFrontend.hooks.addAction( 'frontend/element_ready/wishes.default', addHandler );
}); //wishes.default;
